        .then(response=>{
            if(response.status===200){
                const fetchedData =response.data.rows;
                console.log(fetchedData);
                setData(fetchedData)
            }
        })
        .catch(err=>{

        })
    },[]);

    return(<div>
        Pizza Component
        {
            data.length>0 &&
            data.map((item,index)=>
            <div key={index}>{item}</div>)
        }
    </div>)
}

